import React, { Fragment } from "react";
import { Card, Row, Col } from "antd";

const InformationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(info => (
          <Col key={info.id} span={6}>
            <Card
              key={info.id}
              className="m-2 border border-warning"
              title={
                <p className="text-center bg-light border border-info">{`Table:${info.table}`}</p>
              }
              cover={
                <h1 className="text-center mt-2 font-italic">
                  {info.customer}
                </h1>
              }
            ></Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default InformationList;
